import React from 'react'
import Typed from "react-typed";
import NavbarComp from '../Components/NavbarComp';
import Particles from "react-particles-js";
import '../App.css'

export default function Home() {
    
    
    return (
        <>
            <Particles
                className="particles-canvas"
                params = {{ particles: { number: { value:30, density:{ enable:true, value_area: 900}},
                shape: {type: "circle", stroke: {width:6, color:"#f9ab00"}}}}}/>

            <NavbarComp />
            <div className="header-wrapper">
                <div className="main-info">
                    <h1>Welome To Library Management System</h1>
                    <Typed
                    className="typed-text"
                    strings={["Hi there" , "Browse whatever you like" , "Free Library" , "Membership"]}
                    typeSpeed={40}
                    backSpeed={50}
                    loop
                    />
                    <a href="/contact" className="btn-main-offer">contact us</a>
                </div>
            </div>
        </>
    )
}
